var drawBase = true;
var drawTop = true;

var toInkscapeFromBabylon = 4.045;
var holeDeviationInInkscape = 7.25;
var gearCenterRadiusInInkscape = 3.175;
var pegCenterRadiusInInkscape = 2.97;
var rimRadiusInInkscape = 155;

var characters = [];
characters[15]=["T","O","N","S","E",];//L
characters[16]=["H","N","T","A","D",];//L
characters[3] =["E","O","H","P","B",];//S
characters[8] =["C","M","A","E","Y",];//L
characters[9] =["O","E","T","N","A",];//S
characters[4] =["N","R","W","D","F",];//S
characters[7] =["S","A","A","U","R",];//L
characters[12]=["T","N","S","L","E",];//L
characters[24]=["E","D","D","U","N",];//L
characters[13]=["L","D","E","M","C",];//S
characters[27]=["L","E","S","C","H",];//S
characters[28]=["A","P","C","L","A",];//S
characters[17]=["T","I","R","O","S",];//L
characters[19]=["I","C","I","C","T",];//L
characters[20]=["O","T","B","K","R",];//S

var small = [0, 1, 2, 3, 4];
var large = [0, 2, 4, 1, 3]

GlareSim.Utilities.rotateWholeSetup(gameParameters, 90 * Math.PI/180);    

var edges = GlareSim.Utilities.computeAdjacencies(
    gameParameters,
    function(x1, y1, x2, y2, meshName) { });    

GlareSim.Utilities.setChiralityInBipartiteManner(gameParameters, edges);
GlareSim.Utilities.createGearIntrinsicsFromPegSpecs(gameParameters, edges);
GlareSim.Utilities.setHoleParameters(gameParameters);

var renderSvg = document.getElementById('renderSvg');
renderSvg.setAttributeNS(null, 'height', 600);
renderSvg.setAttributeNS(null, 'width', 800);

var svg = document.createElementNS('http://www.w3.org/2000/svg', 'g');
svg.setAttributeNS(null, 'id', "overall");

var transformString = "translate(0, 300) scale(1, -1)";
svg.setAttributeNS(null, 'transform', transformString);

renderSvg.appendChild(svg);

for (var i = 0; i < gameParameters.pegs.length; i++) {
    var intrinsics = gameParameters.gearIntrinsics[i];
    var peg = gameParameters.pegs[i];

    var size = getSizeByRadius(intrinsics.OuterRadius); 

    if (drawTop) {
        addGearWithHolesAsChild(
            svg,
            "gear" + i,
            toInkscapeFromBabylon * peg.x,
            toInkscapeFromBabylon * peg.y,
            size,
            gearCenterRadiusInInkscape,
            (intrinsics.InnerRadius === 0) ? null : intrinsics.HoleAngle,
            intrinsics.NotchAngles);    
    }

    if (drawBase) {
        addPeg(svg, i, gameParameters);
    }
}

if (drawTop) {
    addGearWithHolesAsChild(
        svg,
        "rimGear",
        toInkscapeFromBabylon * gameParameters.xMax / 2,
        toInkscapeFromBabylon * gameParameters.yMax / 2,
        "XL",
        null,
        null,
        []);    
}

if (drawBase || drawTop) {
    addCircleAsChild(
        svg,
        "rimCircle", 
        toInkscapeFromBabylon * gameParameters.xMax / 2,
        toInkscapeFromBabylon * gameParameters.yMax / 2,
        rimRadiusInInkscape);
}

function addPeg(parent, i, gameParams) {
    var pegElement = document.createElementNS('http://www.w3.org/2000/svg', 'g');
    pegElement.setAttributeNS(null, 'id', "peg" + i);

    var peg = gameParams.pegs[i];
    var x = toInkscapeFromBabylon * peg.x;
    var y = toInkscapeFromBabylon * peg.y;

    var transformString = "translate(" + x + "," + y + ")";
    pegElement.setAttributeNS(null, 'transform', transformString);

    addCircleAsChild(pegElement, "pegHole" + i, 0, 0, pegCenterRadiusInInkscape);

    drawCharactersInHoles(i, gameParams, pegElement);

    parent.appendChild(pegElement);    
}

function drawCharactersInHoles(i, gameParams, pegElement) {
    if (characters[i] != null) {
        var peg = gameParams.pegs[i];
        var angleDeviationDirection = peg.isPositiveChirality ? -1 : 1;

        var gearIntrinsics = gameParams.gearIntrinsics[i];
        
        var n = characters[i].length;
        for (var j = 0; j < n; j++)
        {
            var theta = gearIntrinsics.HoleAngle + (angleDeviationDirection * (j / n) * (2*Math.PI));

            var xHole = holeDeviationInInkscape * Math.cos(theta);
            var yHole = holeDeviationInInkscape * Math.sin(theta);

            var charIndex = gearIntrinsics.OuterRadius > 4.5 ? large : small;
            var character = characters[i][charIndex[j]];

            addCenteredTextAsChild(pegElement, xHole, yHole, character);
        }
    }
}

function addGearWithHolesAsChild(
    parent,
    idPrefix,
    x,
    y,
    size,
    centerHoleWidth,
    windowAngle,
    notchAngles)
{
    var gear = document.createElementNS('http://www.w3.org/2000/svg', 'g');
    gear.setAttributeNS(null, 'id', idPrefix);
    //gear.setAttributeNS(null, 'inkscape:label', idPrefix);

    var transformString = "translate(" + x + "," + y + ")";
    gear.setAttributeNS(null, 'transform', transformString);

    addGearPathAsChild(gear, idPrefix + "_path", size);

    if (centerHoleWidth !== null) {
        addCircleAsChild(gear, idPrefix + "_centerHole", 0, 0, centerHoleWidth);
    }

    if (windowAngle !== null) {
        var wr = holeDeviationInInkscape;
        var wx = wr * Math.cos(windowAngle);
        var wy = wr * Math.sin(windowAngle);
        addCircleAsChild(gear, idPrefix + "_windowHole", wx, wy, 3.25);    
    }

    for (var i = 0; i < notchAngles.length; i++) {
        addRadialLineAsChild(gear, notchAngles[i], 4, getNotchOuterRadius(size));
    }

    parent.appendChild(gear);
}

function addRadialLineAsChild(parent, theta, rInner, rOuter) {
    var line = document.createElementNS('http://www.w3.org/2000/svg', 'line');

    x1 = rInner * Math.cos(theta);
    y1 = rInner * Math.sin(theta);
    x2 = rOuter * Math.cos(theta);
    y2 = rOuter * Math.sin(theta);

    line.setAttributeNS(null, 'x1', x1);
    line.setAttributeNS(null, 'y1', y1);
    line.setAttributeNS(null, 'x2', x2);
    line.setAttributeNS(null, 'y2', y2);

    line.setAttributeNS(null, 'style', "fill:none;stroke:#000000;stroke-width:1.25");

    parent.appendChild(line);
}

function addCircleAsChild(parent, idString, cx, cy, r) {
    var circle = document.createElementNS('http://www.w3.org/2000/svg', 'circle');
    circle.setAttributeNS(null, 'id', idString);
    circle.setAttributeNS(null, 'cx', cx);
    circle.setAttributeNS(null, 'cy', cy);
    circle.setAttributeNS(null, 'r', r);

    circle.setAttributeNS(null, 'style', "fill:none;stroke:#000000;stroke-width:0.26458332");

    parent.appendChild(circle);
}

function addCenteredTextAsChild(parent, x, y, text) {
    var element = document.createElementNS('http://www.w3.org/2000/svg', 'text');
    element.setAttributeNS(null, 'x', x);
    element.setAttributeNS(null, 'y', -y);
    element.setAttributeNS(null, "font-size", 4);
    element.setAttributeNS(null, "alignment-baseline", "middle");
    element.setAttributeNS(null, "text-anchor", "middle");
    element.setAttributeNS(null, "transform", "scale(1, -1)");
    
    var txt = document.createTextNode(text);
    element.appendChild(txt);
    parent.appendChild(element);
}

function addGearPathAsChild(parent, idString, size) {
    var gearPathString = getGearPath(size);

    var gearPath = document.createElementNS('http://www.w3.org/2000/svg', 'path');
    gearPath.setAttributeNS(null, 'id', idString);
    gearPath.setAttributeNS(null, 'd', gearPathString);
    //gearPath.setAttributeNS(null, 'inkscape:connector-curvature', "0");

    gearPath.setAttributeNS(null, 'style', "fill:none;stroke:#000000;stroke-width:0.26458332");

    parent.appendChild(gearPath);
}

function getSizeByRadius(r) {
    if (r < 4) {
        return "S";
    } else if (r < 5) {
        return "M";
    } else if (r < 7) {
        return "L";
    } else {
        return "XL";
    }
}

function getNotchOuterRadius(size) {
    if (size === "S") {
        return 10
    } else if (size === "M") {
        return 15
    } else if (size === "L") {
        return 21
    } else if (size === "XL") {
        return "XL"
    }
}

